import axios from "axios";

export function users(url){
    return (dispatch) => {
        axios.get(url)
        .then(res => dispatch(setPosts(res.data)))
    }
}

export function setPosts(posts){
    return{
        type: 'USERS',
        data: posts,
    }
}
